MongoDB map-reduce (via nodejs): How to include complex modules (with dependencies) in scopeObj?<p>I'm working on a complicated map-reduce process for a mongodb database. I've split some of the more complex code off into modules, which I then make available to my map/reduce/finalize functions by including it in my <code>scopeObj</code> like so:</p>

<pre><code>  const scopeObj = {
    userCalculations: require('../lib/userCalculations')
  }

  function myMapFn() {
    let userScore = userCalculations.overallScoreForUser(this)
    emit({
      'Key': this.userGroup
    }, {
      'UserCount': 1,
      'Score': userScore
    })
  }

  function myReduceFn(key, objArr) { /*...*/ }

  db.collection('userdocs').mapReduce(
    myMapFn,
    myReduceFn,
    {
      scope: scopeObj,
      query: {},
      out: {
        merge: 'userstats'
      }
    },
    function (err, stats) {
      return cb(err, stats);
    }
  )
</code></pre>

<p>...This all works fine. I had until recently thought it wasn't possible to include module code into a map-reduce <code>scopeObj</code>, but it turns out that was just because the modules I was trying to include all had dependencies on other modules. Completely standalone modules appear to work just fine.</p>

<p>Which brings me (finally) to my question. How can I -- or, for that matter, <em>should I</em> -- incorporate more complex modules, including things I've pulled from npm, into my map-reduce code? One thought I had was using Browserify or something similar to pull all my dependencies into a single file, then include it somehow... but I'm not sure what the right way to do that would be. And I'm also not sure of the extent to which I'm risking severely bloating my map-reduce code, which (for obvious reasons) has got to be efficient.</p>

<p>Does anyone have experience doing something like this? How did it work out, if at all? Am I going down a bad path here?</p>

<p><strong><em>UPDATE</em></strong>: A clarification of what the issue is I'm trying to overcome:
In the above code, <code>require('../lib/userCalculations')</code> is executed by Node -- it reads in the file <code>../lib/userCalculations.js</code> and assigns the contents of that file's <code>module.exports</code> object to <code>scopeObj.userCalculations</code>. But let's say there's a call to <code>require(...)</code> somewhere within <code>userCalculations.js</code>. That call isn't actually executed yet. So, when I try to call <code>userCalculations.overallScoreForUser()</code> within the Map function, MongoDB attempts to execute the <code>require</code> function. And <code>require</code> isn't defined on mongo.</p>

<p>Browserify, for example, deals with this by compiling all the code from all the required modules into a single javascript file with no <code>require</code> calls, so it can be run in the browser. But that doesn't exactly work here, because I need to be the resulting code to itself be a module that I can use like I use <code>userCalculations</code> in the code sample. Maybe there's a weird way to run browserify that I'm not aware of? Or some other tool that just "flattens" a whole hierarchy of modules into a single module?</p>

<p>Hopefully that clarifies a bit.</p>

