Mongoose .pre('save') not triggering - bcrypt<p>I have been trying to create a simple Authentication app but facing this issue of <code>.pre('save')</code> middleware not triggering at all when I'm trying to save the hashed password in Mongodb.
Here's my <code>Model.js</code> File.</p>

<pre><code>import mongoose from 'mongoose';
import bcrypt from 'bcryptjs';

const userSchema = new mongoose.Schema({
  auth_method: {
    type: String,
    enum: ['local', 'google', 'facebook'],
    required: true
  },
  email: {
    type: String,
    lowercase: true,
    unique: true
  },
  local: {
    password: {
      type: String
    }
  },
  google: {
    id: {
      type: String
    }
  },
  facebook: {
    id: {
      type: String
    }
  }
},
  {
    collection: 'Users'
  });

const userModel = module.exports = mongoose.model('Users', userSchema);

userSchema.pre('save', function (next) {
  console.log("this:",this); //  Nothing prints to the console here
  if (this.auth_method !== 'local') {
    next();
  }
  bcrypt.genSalt(10, function (error, salt) {
    if (error) throw error;
    bcrypt.hash(this.local.password, salt, function (err, hashPassword) {
      if (err) throw err;
      else {
        this.local.password = hashPassword;
        next();
      }
    });
  });
});

const comparePassword = (candidatePassword, hashPassword) =&gt; {
  return new Promise((resolve, reject) =&gt; {
    bcrypt.compare(candidatePassword, hashPassword, (err, isMatch) =&gt; {
      if (err) reject(err);
      resolve(isMatch);
    });
  });
};

const saveUser = (user) =&gt; user.save();

const findUserByEmail = (email) =&gt; userModel.findOne({ email });

const findUserById = (id, cb) =&gt; { userModel.findById(id, cb); };

module.exports = {
  userModel,
  comparePassword,
  saveUser,
  findUserByEmail,
  findUserById
};
</code></pre>

<p>Any help is appreciated, I have tried all possible solutions suggested in other threads, none worked including <code>return next(this)</code>
Even in the database, there's no field for <code>local: {password: 'hashedPassword'}</code></p>

