Updating Property on Object with MongoDB Without Wiping Out Surrounding Properties<p>I have a Node/MongoDB backend endpoint that takes a passed in an array of mongo _ids, and then updates a field on the records matching those passed in ids. </p>

<pre><code>if (mongoArrRecords) {
    try {
        db.collection('clients').updateMany(
            { _id: { $in: mongoArrRecords } },
            { $set: { subscription: { subscriptionEnd: lastDayOfMonth } } },
            function (err, res) {
                if (err) throw err;
                console.log(res);
            });
        res.sendStatus(200);
    } catch (e) {
        console.log(e);
    }

}
</code></pre>

<p>However, what I'm noticing is is that rather than merely updating the property I'm defining with the <code>$set</code> operator, the entire containing object is being wiped out and replaced with this one property. </p>

<p>The data being targeted looks like this (subscription) is an array at the root of the document:</p>

<pre><code>   "subscription": [
        {
            "someProp": value,
            "someOtherProp": value,
            "subscriptionEnd": "2017-04-30T05:00:00.000Z",
        }
    ],
</code></pre>

<p>So my question is: how I can make this update just the field in question, without wiping out the surrounding properties within the object? Because right now, after making my update, the above data looks like this (notice "someProp" and "someOtherProp" are now gone):</p>

<pre><code>   "subscription": [
        {
            "subscriptionEnd": "2018-04-30T05:00:00.000Z",
        }
    ],
</code></pre>

<p>If I can't target precisely, the only other option I can imagine is getting the object first, and passing back in that entire object -- though I'm not sure exactly what that would look like. Surely there must be a way to change one property on one object within an array? Yes? No?</p>

