How can I achieve mongo "unwind" in postgres JSONB? (Flatten nested arrays)<p>I recently looked into migrating our product database from mongo to postgres. Coming from mongoDb, I am used of "unwinding" objects and arrays.</p>

<p>Suppose you have the following object:</p>

<pre><code>{
  "styleGroupId": "2",
  "brand": "MOP",
  "colorVariants": [
    {
        "color": "red",
        "colorCode": "222",
        "sizeVariants": [
           {"gtin": "444",
           "size": "M"},
           {"gtin": "555",
           "size": "L"}
       ]
    },
    {
        "color": "blue",
        "colorCode": "111",
        "sizeVariants": [
           {"gtin": "66",
           "size": "M"},
           {"gtin": "77",
           "size": "L"}
       ]
    }
    ]
}
</code></pre>

<p>If you want to flatten it, in mongo you use the following:</p>

<pre><code>db.test.aggregate([
{
    $unwind: "$colorVariants"
},
{
    $unwind: "$colorVariants.sizeVariants"
}
])
</code></pre>

<p>which will result in objects like this:</p>

<pre><code>{
    "_id" : ObjectId("5a7dc59dafc86d25964b873c"),
    "styleGroupId" : "2",
    "brand" : "MOP",
    "colorVariants" : {
        "color" : "red",
        "colorCode" : "222",
        "sizeVariants" : {
            "gtin" : "444",
            "size" : "M"
        }
    }
}
</code></pre>

<p>I have spent hours searching for "mongo unwind in postgres" but could hardly find a satisfying answer. Also a lot of the resources on querying JSONB data in postgres barely touch nested arrays. Hopefully this post will help other poor souls searching for a migration from mongoDb to postgres.</p>

