How to construct a mongo query that aggregates on two fields?<p><strong>TL;DR; How do I query mongo in a way that aggregates a collection two different ways?</strong></p>

<p>I'm learning to query MongoDB.  Suppose that I have a collection that contains the results of users submitting a questionnaire and then reviewers signing off that they have reviewed it.</p>

<p>A record in my collection looks like this:</p>

<pre><code>{
    _id: 0,
    Questions:
    [
        {
            label: "fname",
            response: "Sir"
        },  
        {
            label: "lname",
            response: "Robin"
        },
        {
            label: "What is your name?",
            response: "Sir Robin of Camelot"
        },
        {
            label: "What is your quest?",
            response: "To seek the holy grail"
        },
        {
            label: "What is the capital of Asyria?",
            response: "I don't know that."
        }
    ],
    Signatures:
    [
        "Lancelot",
        "Arthur"
    ]
}
</code></pre>

<p>I am creating a report that will display a summary of each record.
For each record, I need to display the following:</p>

<ul>
<li><p>The first name</p></li>
<li><p>The last name</p></li>
<li><p>The number of signatures.</p></li>
</ul>

<p>I am able to write an aggregate query that gets the first and last name.
I am also able to write an aggregate query that gets the number of signatures.</p>

<p>However, I am stuck when I try to write an aggregate query that gets both.</p>

<pre><code>// In order to query the first and last name, I use this query:
[
    { $unwind: "$Questions" },
    { $match: { "Questions.Label": { $in: ["fname", "lname"] } } },
    { $project: { "Questions": 1 } },
    { $group: { _id: "$_id", Questions: { $push: "$Questions" } } }
]

// In order to query the number of signatures, I use this query:
[
    { $project: { "SignatureCount": { $size: "$Signatures" } } }
]
</code></pre>

<p>Everything works with these two queries, but I want to write a single query that returns the data all together.</p>

<p>So, for example, if the example record above were the only record in my collection, I would want the query to return this:</p>

<pre><code>{
    _id: 0,
    Questions:
    [
        {
            label: "fname",
            response: "Sir"
        },  
        {
            label: "lname",
            response: "Robin"
        }
    ],
    SignatureCount: 2
}
</code></pre>

